    // MATCH: frame_9/DoAction.as:addNewAchievement()
    public void addNewAchievement(double ID, string name, string desc, string need, double amnt, string type, string where, bool secret, double redCoin)
    {
        _root.totalachievements += 1;
        if (secret == true)
        {
            _root.totalsachievements += 1;
        }
        _root.maxredcoin += redCoin;
        var achievement = new Achievement();
        achievement.ID = ID;
        achievement.name = name;
        achievement.desc = desc;
        achievement.need = need;
        achievement.amnt = amnt;
        achievement.type = type;
        achievement.where = where;
        achievement.secret = secret;
        achievement.redCoin = redCoin;
        _root.achList.Add(achievement);
    }

    // MATCH: frame_9/DoAction.as:addNewQuest()
    public void addNewQuest(bool expired, bool eventQuest, bool dailyQuest, double questID, double questImage, double reqLevel, double reqQuest, double reqQuestRank, string questName, string descA, string descB, string need, string where, double amnt1, double amnt2, double amnt3, double amnt4, double questToken, double eventToken)
    {
        _root.totalMainQuest += 1;
        var quest = new Quest();
        quest.expired = expired;
        quest.eventQuest = eventQuest;
        quest.dailyQuest = dailyQuest;
        quest.questID = questID;
        quest.questImage = questImage;
        quest.reqLevel = reqLevel;
        quest.reqQuest = reqQuest;
        quest.reqQuestRank = reqQuestRank;
        quest.questName = questName;
        quest.descA = descA;
        quest.descB = descB;
        quest.need = need;
        quest.where = where;
        quest.amnt1 = amnt1;
        quest.amnt2 = amnt2;
        quest.amnt3 = amnt3;
        quest.amnt4 = amnt4;
        quest.questToken = questToken;
        quest.eventToken = eventToken;
        _root.mainQuestList.Add(quest);
    }

    // MATCH: frame_9/DoAction.as:addRandomQuest()
    public void addRandomQuest(double chance, double difficulty, double maxMult, double reqLv, string reward, double rewardQuan, double rewardBlueCoin, double rewardToken, string feature, string type, string subtype, double need, string descA, string descB)
    {
        var rq = new RandomQuest();
        rq.chance = chance;
        rq.difficulty = difficulty;
        rq.maxMult = maxMult;
        rq.reqLv = reqLv;
        rq.feature = feature;
        rq.type = type;
        rq.subtype = subtype;
        rq.need = need;
        rq.reward = reward;
        rq.rewardQuan = rewardQuan;
        rq.rewardBlueCoin = rewardBlueCoin;
        rq.rewardToken = rewardToken;
        rq.descA = descA;
        rq.descB = descB;
        _root.questList.Add(rq);
        _root.totalquest += 1;
    }

    // MATCH: frame_9/DoAction.as:addAchievementR()
    public void addAchievementR(double ID, bool secret, string achName, string descA, string descB, string need, string where, List<double> amnt)
    {
        var achr = new AchR();
        achr.ID = ID;
        achr.secret = secret;
        achr.achName = achName;
        achr.descA = descA;
        achr.descB = descB;
        achr.need = need;
        achr.where = where;
        achr.amnt = amnt;
        _root.achListR.Add(achr);
    }

